import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import {showCallPage} from "../../../redux/action";


const ExtensionsList = () => {
    const devicesData = useSelector(state => state.devicesData);
    const loginData = useSelector(state => state.loginData);
    const [data, getData] = useState({item: []})
    useEffect(() => {
        const array = data.item;
        array.push(devicesData.item);

        getData({...data, item: array.item});
        console.log("datad", data)
        console.log("devicesData22", devicesData)
        data.item.map((i, item) => {
            return (
                <a key={i}>
                    <p>a</p>
                </a>
            )

        })
    }, [loginData])

    return (
        <React.Fragment>
            {
                devicesData === undefined ? null :  devicesData.item[0].map((i, item) => {
                    return (
                        <a key={i}>
                            <p>a</p>
                        </a>
                    )

                })
            }

        </React.Fragment>
    )
}


export default ExtensionsList;
